import './App.css';
import Navigation from './componenets/navigation/Navigation';
import Logo from './componenets/logo/Logo';
import Rank from './componenets/rank/rank'
import ImageLink from './componenets/imageLink/imageLink';
import Particles from 'react-particles-js';
import { Component } from 'react';
import Clarifai from 'clarifai';
import FaceReco from './componenets/face';

const particleOptions = {
  particles: {
    number: {
      value: 30,
      density: {
        enable: true,
        value_area: 8000
      }
    }
  }
}

const app = new Clarifai.App({ apiKey: '8574ae4ec5094e459de26dbf89fe7742' });



class App extends Component {

  constructor() {
    super();
    this.state = {
      input: '',
    }
  }


  onInputChange = (event) => {
    console.log(event);
  }

  onButtonSubmit = () => {

    //metadata.set("authorization", "Key {8574ae4ec5094e459de26dbf89fe7742}");

    app.models.predict('8574ae4ec5094e459de26dbf89fe7742', this.state.input)
  };

  render() {

    return (
      <div className="App" >

        <Particles className='particles' />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLink onInputChange={this.onInputChange} onSubmit={this.onButtonSubmit} />
        <FaceReco />

      </div>
    );
  }
}

export default App;
